let V = scanints(4).sorted(cmp,Descending)
let (a0,a1,a2,a3) = (V[0]-1,V[1]-1,V[2]-1,V[3]-1)
if ANS.len > a0 and ANS[a0].len > a1 and ANS[a0][a1].len > a2 and ANS[a0][a1][a2].len>a3:echo ANS[a0][a1][a2][a3]
else:echo 4